require.config({"config": {
        "text":{"Magento_Ui/templates/grid/editing/bulk.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<tr class=\"data-grid-bulk-edit-panel data-grid-editable-row\" each=\"data: fields, as: '$col'\" visible=\"active\">\n    <td if=\"$parent.getColumn(index).visible\" css=\"'data-grid-actions-cell': $parent.isActionsColumn($col)\">\n        <if args=\"$parent.isActionsColumn($col)\">\n            <with args=\"$parent\">\n                <button class=\"action-default\" type=\"button\" click=\"apply\" disable=\"!hasData\">\n                    <span translate=\"'Apply'\"></span>\n                </button>\n            </with>\n        </if>\n\n        <if args=\"$data.isEditor\">\n            <label class=\"admin__field-label admin__field-label-vertical\" attr=\"for: uid\" translate=\"'All in Column'\"></label>\n            <render></render>\n        </if>\n    </td>\n</tr>\n"}
}});
